import React from 'react';
import UserList from './UserList';
import NeonCursor from './NeonCursor';

const UserListWithNeonCursor = ({ users, editUser, deleteUser }) => {
  return (
    <>
      <UserList
        users={users}
        editUser={editUser}
        deleteUser={deleteUser}
      />
      <NeonCursor /> {/* Ajoutez le composant NeonCursor ici */}
    </>
  );
};

export default UserListWithNeonCursor;
